import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper-bundle.min.css'; // импортируйте стили Swiper
import 'swiper/components/navigation/navigation.min.css'; // опциональные стили для навигации
import 'swiper/components/pagination/pagination.min.css'; // опциональные стили для пагинации
import 'swiper/components/scrollbar/scrollbar.min.css'; // опциональные стили для скроллбара
import SwiperCore, { Navigation, Pagination, Scrollbar, A11y } from 'swiper';

// установка компонентов Swiper, которые вы планируете использовать
SwiperCore.use([Navigation, Pagination, Scrollbar, A11y]);

const MySwiper = () => {
  return (
    <Swiper
      spaceBetween={30}
      slidesPerView={1}
      navigation
      pagination={{ clickable: true }}
      scrollbar={{ draggable: true }}
    >
      <SwiperSlide>
        <div className="bg-blue-500 h-64 flex items-center justify-center">
          <p className="text-white text-2xl">Слайд 1</p>
        </div>
      </SwiperSlide>
      <SwiperSlide>
        <div className="bg-green-500 h-64 flex items-center justify-center">
          <p className="text-white text-2xl">Слайд 2</p>
        </div>
      </SwiperSlide>
      <SwiperSlide>
        <div className="bg-red-500 h-64 flex items-center justify-center">
          <p className="text-white text-2xl">Слайд 3</p>
        </div>
      </SwiperSlide>
    </Swiper>
  );
};

export default MySwiper;
